	(49,'2016-05-29',66,320,136,481,778627,2339760,4192,20512,14367,1304503,990135,90118,'李博故障报告:\n\n首先请允许我说声抱歉，由于我的误操作导致这次发生的生产事故，在此我把情况描述下，希望我与其他同事们今后可以引以为戒，避免类似情况再次发生。\n\n1、故障表现为本周日早上监控发现dw_connection_wechat 该job运行失败，以及导致依赖它的以下job也运行失败\nbig_dw_db_temp_sql\nda_broker_service_eval\nda_landlord_without_link\nda_broker_service_community_eval\nda_landlord_service_eval\nda_broker_level_score \n由于dw_connection_wechat这张表结构发生变更导致相关job的失败\n\n2、根本原因是 本周我在做微聊和首聊的需求，微聊明细表命名为dw_connection_wechat_sd,\n后来经过stanley review后我的表命名不太规范，所以周六决定重命名为dw_connection_wechat，\n建表方式使用了drop table if exists dw_connection_wechat\n                            create table dw_connection_wechat ...\n在这里漏掉了很重要的一步，建表前先查询该表是否已存在并使用的情况，导致我把之前已经存在的dw_connection_wechat表结构给更改了，这里一定要引以为戒，慎重慎重。。。\n\n3、修复措施：\n发现该故障后马上进行定位，报错的job原因和列出所依赖所有的job清单\n1）重建dw_connection_wechat该表表结构\n2）恢复dw_connection_wechat​该表历史数据，由于属于管理表，从hdfs回收站循环把历史数据重新拷贝到每一个分区中并重建分区\n3）重新运行dw_connection_wechat该job今日的调度，恢复当日数据\n4）确保dw_connection_wechat数据都恢复成功后，再依次运行依赖它的所有job清单并检测是否成功\n5）通知minireport以及da模块的负责人，看是否有其他未知的影响，以便能把风险降低至最小\n\n4、后续注意​\n此次事故深刻告知今后若有新需求，需要重建表等情况，一定要先确定该表不存在情况下\n才能新建表，避免新建表已经存在的情况，在此一定需要非常谨慎处理。\n\n最后在此感谢jason和stanley的给力支持，才使得这次事故得以解决没有造成更大的影响，\n我也会引以为戒以此自省，thanks！\n'),
