	(214,'2016-11-10',129,719,175,944,1429465,4300285,7350,37056,33280,936489,593707,98348,'dw_hive_server 故障\n\ndw_hive_server 在 HiveUtil 的 清理 job 任务中, 使用了 org.apache.hadoop.mapred.JobClient 客户端连接 master2 上的 resoucemanager  服务（用于获取 job 状态和清理 job），由于 ucloud resoucemanager 服务在 master2 异常切换 到 master1 上, 导致 dw_hive_server 服务器异常。\n\n\n错误现象:\n\nINFO - Retrying connect to server: uhadoop-ociicy-master2/10.10.20.223:23140. Already tried 5 time(s); retry policy is RetryUpToMaximumCountWithFixedSleep(maxRetries=10, sleepTime=1000 MILLISECONDS)\nINFO - Retrying connect to server: uhadoop-ociicy-master2/10.10.20.223:23140. Already tried 6 time(s); retry policy is RetryUpToMaximumCountWithFixedSleep(maxRetries=10, sleepTime=1000 MILLISECONDS)\nINFO - Retrying connect to server: uhadoop-ociicy-master2/10.10.20.223:23140. Already tried 7 time(s); retry policy is RetryUpToMaximumCountWithFixedSleep(maxRetries=10, sleepTime=1000 MILLISECONDS)\nINFO - Retrying connect to server: uhadoop-ociicy-master2/10.10.20.223:23140. Already tried 8 time(s); retry policy is RetryUpToMaximumCountWithFixedSleep(maxRetries=10, sleepTime=1000 MILLISECONDS)\nINFO - Retrying connect to server: uhadoop-ociicy-master2/10.10.20.223:23140. Already tried 9 time(s); retry policy is RetryUpToMaximumCountWithFixedSleep(maxRetries=10, sleepTime=1000 MILLISECONDS)\nERROR - Fail to execute query.\njava.net.ConnectException: Call From bi3/10.10.64.232 to uhadoop-ociicy-master2:23140 failed on connection exception: java.net.ConnectException: Connection refused; For more details see:  http://wiki.apache.org/hadoop/ConnectionRefused\n        at sun.reflect.NativeConstructorAccessorImpl.newInstance0(Native Method)\n        at sun.reflect.NativeConstructorAccessorImpl.newInstance(NativeConstructorAccessorImpl.java:57)\n        at sun.reflect.DelegatingConstructorAccessorImpl.newInstance(DelegatingConstructorAccessorImpl.java:45)\n        at java.lang.reflect.Constructor.newInstance(Constructor.java:526)\n        at org.apache.hadoop.net.NetUtils.wrapWithMessage(NetUtils.java:783)\n        at org.apache.hadoop.net.NetUtils.wrapException(NetUtils.java:730)\n        at org.apache.hadoop.ipc.Client.call(Client.java:1413)\n        at org.apache.hadoop.ipc.Client.call(Client.java:1362)\n        at org.apache.hadoop.ipc.WritableRpcEngine$Invoker.invoke(WritableRpcEngine.java:231)\n        at org.apache.hadoop.mapred.$Proxy6.jobsToComplete(Unknown Source)\n        at org.apache.hadoop.mapred.JobClient.jobsToComplete(JobClient.java:1380)\n        at code.util.HiveUtil$.cleanupMapred(HiveUtil.scala:322)\n        at code.util.HiveUtil$.runQuery(HiveUtil.scala:422)\n        at code.util.HiveUtil$.executeHive(HiveUtil.scala:266)\n        at code.util.HiveUtil$.execute(HiveUtil.scala:76)\n        at code.lib.TaskActor.code$lib$TaskActor$$process(TaskActor.scala:122)\n        at code.lib.TaskActor.code$lib$TaskActor$$processJson(TaskActor.scala:84)\n        at code.lib.TaskActor$$anonfun$receive$1.applyOrElse(TaskActor.scala:63)\n        at akka.actor.Actor$class.aroundReceive(Actor.scala:465)\n        at code.lib.TaskActor.aroundReceive(TaskActor.scala:49)\n        at akka.actor.ActorCell.receiveMessage(ActorCell.scala:516)\n        at akka.actor.ActorCell.invoke(ActorCell.scala:487)\n        at akka.dispatch.Mailbox.processMailbox(Mailbox.scala:238)\n        at akka.dispatch.Mailbox.run(Mailbox.scala:220)\n        at akka.dispatch.ForkJoinExecutorConfigurator$AkkaForkJoinTask.exec(AbstractDispatcher.scala:393)\n        at scala.concurrent.forkjoin.ForkJoinTask.doExec(ForkJoinTask.java:262)\n        at scala.concurrent.forkjoin.ForkJoinPool$WorkQueue.runTask(ForkJoinPool.java:975)\n        at scala.concurrent.forkjoin.ForkJoinPool.runWorker(ForkJoinPool.java:1478)\n        at scala.concurrent.forkjoin.ForkJoinWorkerThread.run(ForkJoinWorkerThread.java:104)\nCaused by: java.net.ConnectException: Connection refused\n'),
