	(216,'2016-11-12',131,974,177,1035,1384976,4170348,7385,44952,55997,1127034,723376,85786,' java.io.IOException: Job status not available\n\n\n    Hadoop集群上跑mapreduce，在job任务执行完成退出时报 java.io.IOException: Job status not available异常。Job client请求job状态时，Application已经完成转而去Job history server请求job状态，就在这里抛出异常。\n\n\n出发方法 http://xubcing.blog.51cto.com/3502962/1659823'),
