	(226,'2016-11-22',135,579,166,812,1473664,4435335,7655,40507,29038,1049707,751214,108282,'现象: \n  由于 hbase 连接 zookeeper 超时导致 spark 出现 Deadlock when retreiving shuffled cached data 异常, 并且不会停下来, 直到 jvm 的 Java heap space 用光为止, 这本身是一个 spark 的 Bug, https://issues.apache.org/jira/browse/SPARK-15558 .\n \n  错误: org.apache.zookeeper.KeeperException$SessionExpiredException: KeeperErrorCode = Session expired  // 超时\n        at org.apache.hadoop.hbase.zookeeper.ZooKeeperWatcher.connectionEvent(ZooKeeperWatcher.java:410)\n        at org.apache.hadoop.hbase.zookeeper.ZooKeeperWatcher.process(ZooKeeperWatcher.java:321)\n  \n详细原因:\n  出现这个错误的原因是由于我们在 房源画像代码里大量使用了:  scan 查询和  scanByRowFilterRegex 查询。\n      这些查询都不是直接命中 HBase 的索引查询, 而是通过正则一行行匹配 HBASE 的 Row-key , 直到找到数据为止, 当大量查询时, 就会直接导致系统连接超时异常，最终导致以上错误产生\n\n\n     com.angejia.dw.hadoop.hbase.HBaseClient.scanByRowFilterRegex(HBaseClient.scala:354) // scan 查询方法, 出问题的地方\n     com.angejia.dw.recommend.inventory.portrait.InventoryPortraitCommon$.getInventoryPortraitByInventoryId(InventoryPortraitCommon.scala:26)  // 通过房源 ID scan HBase 的数据\n\n     这个方法, 这个房源是通过 Hbase 的 scan 查找数据, 并没有使用 row-key 直接命中 row-key , 大量的查询导致 zookeeper 与 Hbase 查询连接超时. 最终导致程序崩溃\n\n解决方案: \n  1. 去除这个低效率的查询方法, HBASE 只适合做直接命中 row-key 的查询，比如用户画像的用户 id \n  2. 把查询房源信息的数据，切换到 MYSQL 中直接通过 inventory id 主键查询\n '),
